package com.dev.doodle.vo;

import java.sql.Timestamp;

public class Burger {
			 
	 private int no,burgerking;
	 private String startSentence,endSentence;
	 private Timestamp regdate;
	 
	 
	 
	 
	 public Burger() {
		// TODO Auto-generated constructor stub
	}




	public int getNo() {
		return no;
	}




	public void setNo(int no) {
		this.no = no;
	}




	public int getBurgerking() {
		return burgerking;
	}




	public void setBurgerking(int burgerking) {
		this.burgerking = burgerking;
	}




	public String getStartSentence() {
		return startSentence;
	}




	public void setStartSentence(String startSentence) {
		this.startSentence = startSentence;
	}




	public String getEndSentence() {
		return endSentence;
	}




	public void setEndSentence(String endSentence) {
		this.endSentence = endSentence;
	}




	public Timestamp getRegdate() {
		return regdate;
	}




	public void setRegdate(Timestamp regdate) {
		this.regdate = regdate;
	}



	 
	
	 
	 
	 

}
